Tam giác $POD$ là tam giác 30-60-90, vì vậy $DO = \frac{\sqrt{3}}{2}$ và $DP = \frac12$. Do đó, tọa độ của $P$ là $\left(-\frac{\sqrt{3}}{2}, -\frac12\right)$, do đó $$\tan 210^\circ =\frac{\sin 210^\circ}{\cos 210^\circ} = \frac{-1/2}{-\sqrt{3}/2} = \frac{1}{\sqrt{3}} = \boxed{\ frac{\sqrt{3}}{3}}.$$

Chúng ta có thể mở rộng định thức như sau:
\bắt đầu{căn chỉnh*}
\begin{vmatrix} 0 & b - a & c - a \\ a - b & 0 & c - b \\ a - c & b - c & 0 \end{vmatrix} &= -(b - a) \ started{vmatrix} a - b & c - b \\ a - c & 0 \end{vmatrix} + (c - a) \begin{vmatrix} a - b & 0 \\ a - c & b - c \end {vmatrix} \\
&= -(b - a)(-(c - b)(a - c)) + (c - a)(a - b)(b - c) \\
&= \đóng hộp{0}.
\end{căn chỉnh*}

Chúng tôi có cái đó
\bắt đầu{căn chỉnh*}
\frac{\csc \theta}{\sin \theta} - \frac{\cot \theta}{\tan \theta} &= \frac{1/\sin \theta}{\sin \theta} - \frac {\cos \theta/\sin \theta}{\sin \theta/\cos \theta} \\
&= \frac{1}{\sin^2 \theta} - \frac{\cos^2 \theta}{\sin^2 \theta} \\
&= \frac{1 - \cos^2 \theta}{\sin^2 \theta} = \frac{\sin^2 \theta}{\sin^2 \theta} = \boxed{1}.
\end{căn chỉnh*}

