Hình tam giác được hiển thị dưới đây:

[asy]
cặp B,C,D;
C = (0,0);
D = (sqrt(65),0);
B = (sqrt(65),4);
hòa(B--C--D--B);
draw(rightanglemark(B,D,C,13));
nhãn("$C$",C,SW);
nhãn("$B$",B,NE);
nhãn("$D$",D,SE);
label("$9$",(B+C)/2,NW);
nhãn("$4$",(B+D)/2,E);
