Định lý Pythagore cho chúng ta $CD = \sqrt{BC^2 - BD^2} = \sqrt{81 - 16} = \sqrt{65}$, do đó $\sin B = \frac{CD}{BC} = \boxed{\frac{\sqrt{65}}{9}}$.
